import React from "react";
import './contact.css';
import { useState } from "react";

function Form(){

    const [text,setText] = useState();
    const [email,setEmail] = useState();
    const [message,setMessage] = useState();

    const pressText = (value) =>{
        setText()
    }

    return(
        <form action="POST">
            <input onClick={pressText} type="text" name="name" id="name" placeholder="Name"/>
            <input onClick={pressEmail} type="email" id="email" placeholder="Email"/>
            <input onClick={pressMessage} type="text" id="message" placeholder="Message"/>
            <button>Send</button>
        </form>
    )
}

export default Form;
